import './App.css';
import React, { useEffect } from 'react';

function App() {
  useEffect(() => {
    setInterval(() => {
      updateGreetingLanguage();
    }, 5000);

  })

  return (
    <div className="App">
      <header className="App-header">
        <img src="./logo.svg" className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to relad.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;

function updateGreetingLanguage() {
  console.log()
}
